import {
    Switch,
    Route
  } from "react-router-dom";
  import Register from '../component/Register/Register';
  import Users from '../component/ManageUsers/Users';
  import Login from '../component/Login/Login';
const AppRoutes = (props) => {
    return (
        <>
            <Switch>
                <Route path="/product">
                    product
                </Route>
                <Route path="/login">
                    <Login />
                </Route>
                <Route path="/register">
                    <Register />
                </Route>
                <Route path="/users">
                    <Users />
                </Route>
                <Route path="/" exact>
                    HOme
                </Route>
                <Route path='*'>
                    Not Found
                </Route>
            </Switch>
        </>
    )
}
export default AppRoutes;
